const Projects = () => {
  const projects = [
    {
      title: 'E-Commerce Platform',
      description: 'Full-stack e-commerce solution with React, Node.js, and MongoDB',
      image: 'fas fa-shopping-cart',
      tech: ['React', 'Node.js', 'MongoDB', 'Stripe'],
      link: '#'
    },
    {
      title: 'Social Media App',
      description: 'Real-time social media application with chat functionality',
      image: 'fas fa-users',
      tech: ['React', 'Socket.io', 'Express', 'PostgreSQL'],
      link: '#'
    },
    {
      title: 'Portfolio Website',
      description: 'Responsive portfolio website with modern design',
      image: 'fas fa-globe',
      tech: ['HTML5', 'CSS3', 'JavaScript', 'Bootstrap'],
      link: '#'
    }
  ];

  return (
    <section id="projects" className="section-padding bg-light" role="region" aria-labelledby="projects-title">
      <div className="container">
        <h2 id="projects-title" className="section-title h1">My Projects</h2>
        <div className="row g-4">
          {projects.map((project, index) => (
            <div className="col-lg-4 col-md-6" key={index} data-aos="fade-up" data-aos-delay={index * 100}>
              <article className="card h-100">
                <div className="card-body text-center p-4">
                  <i className={`${project.image} fa-4x text-primary mb-3`} aria-hidden="true"></i>
                  <h3 className="card-title h4">{project.title}</h3>
                  <p className="card-text mb-3">{project.description}</p>
                  <div className="mb-3">
                    {project.tech.map((tech, techIndex) => (
                      <span key={techIndex} className="badge bg-secondary me-1 mb-1">{tech}</span>
                    ))}
                  </div>
                  <a 
                    href={project.link} 
                    className="btn btn-primary"
                    aria-label={`View ${project.title} project`}
                  >
                    <i className="fas fa-external-link-alt me-2" aria-hidden="true"></i>
                    View Project
                  </a>
                </div>
              </article>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};
